import { GET_MF_BANK, GET_MF_BANK_SUCCESS, GET_MF_BANK_PENDING } from '../store/Action/type';
import { takeLatest, call, put } from 'redux-saga/effects';
import Api from '../services/onboarding';
let getApi = new Api();

async function getFetch(res) {

    let data = await getApi.getMFBanks(res);
    return data
}

function* fetchUser(action) {
    console.log('mastersaga')
    let { payload } = action;
    let getData = yield call(getFetch, payload);
    if (getData.success) {
        let data = getData.response.data;
        yield put({ type: GET_MF_BANK_SUCCESS, paylaod: data })

    } else {
        let data = [];
        yield put({ type: GET_MF_BANK_PENDING, paylaod: data })
    }
    console.log(getData, 'getData')
    // getApi.getCommonMaster().then(result => {
    //     console.log(result, 'callmastersaga')
    // })
}

export function* getMFBank() {
    yield takeLatest(GET_MF_BANK, fetchUser);
}
